import React, { useState } from 'react';

function App() {
  const [data, setData] = useState(null);

  const scrapeData = async () => {
    const response = await fetch('http://localhost:3000/api/scraper/scrape?url=YOUR_TARGET_URL');
    const result = await response.json();
    setData(result.data);
  };

  return (
    <div>
      <h1>Welcome to Car Compass</h1>
      <button onClick={scrapeData}>Scrape Data</button>
      {data && <div>Scraped Data: {data}</div>}
    </div>
  );
}

export default App;
